import React, {useState} from 'react'
import Cnt from ".components/cnt.js";

function App() {
  const [inputValue, inputValueChange]  = useState("type smth")

  function inputValueHandler( arg ){
    inputValueChange(arg?arg:"-")
  }

  return (
    <div className="App">
        <Cnt/>
        <hr/>
        <h1> {inputValue} </h1>
        <input
            onChange = { e => inputValueHandler(e.target.value )}
            type = "text"
            value = {inputValue}
        />
    </div>
  );
}

export default App;
